import logo from './logo.svg';
import './App.css';

const Hello = (props) => {
  return(
      <div>
        <p>oh hey! {props.name}</p>
      </div>
  )
}

const Response1 =
  <div>
    <p> How are you?</p>
  </div>

const Response2 =
      <div>
        <p> I'm fine thank you so much</p>
      </div>


function App() {
  const now = new Date()
  const M_age = 30
  const B_age = 2
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <Hello name="Maya"></Hello>
        <Response1></Response1>

        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
